  frontend: 'I love everything related to Front-End, creating websites for clients, mobile apps, and things vinculated to the visible part of programming.',
};

const contactTranslations = {
  contact: 'Contact',
  sendEmail: 'Send Email',
  contactInfo: 'Contact Information:',
  phone: 'Phone:',
};

const homeTranslations = {
  home: 'Home',
  name: 'Name',
  email: 'Email',
  message: 'Message',
};

const skillsTranslations = {
  skills: 'Skills',
  portfolio: 'Take a look at all my projects:',
};

const workTranslations = {
  work: 'Work',
  project1: 'Project 1 Name',
  project2: 'Project 2 Name',
  project3: 'Project 3 Name',
  code: 'Code',
};

export default {
  ...aboutTranslations,
  ...contactTranslations,
  ...homeTranslations,
  ...skillsTranslations,
  ...workTranslations,
  selectLanguage: 'Select a language:',
  spanish: 'Spanish',
  catalan: 'Catalan',
  english: 'English',
};
